changeSet.sql:

           SET SCHEMA '${SCHEMA}';
           create temp table nt_sys_type_table
(
    a varchar,
    b integer,
    c varchar,
    d varchar,
    e integer);
create or replace function sys_type_function(aa varchar, bb integer, cc varchar, dd bytea, ee integer)
    returns void
    language plpgsql
    as
 $$
           BEGIN
           insert into nt_sys_type_table(a, b, c, d, e) values (aa, bb, cc, dd, ee);
           end;
 $$;
 DO
 $$
   declare
           nt_sys_type  nt_sys_type_table%ROWTYPE;
       v_attr1 varchar;
       v_attr2 integer;
       v_attr3 varchar;
       v_attr4 bytea;
       v_attr5 integer;
       checkf integer;
           begin
   perform sys_type_function('aspirin', 20, '0c09f412-a001-43f0-8557-54c31c46657d', '',
       2);
   perform sys_type_function('aspirin', 50, 'bdf8bb74-9319-4313-b294-c7a88f6a071a', '',
       2);
   perform sys_type_function('antiseptic', 220, '7029bf25-a51d-4868-a8df-785c973c638', '',
       1);
   perform sys_type_function('aspirin', 50, 'a2aedc39-85e7-4d26-9ac1-57e5465069a8', '',
       2);
   perform sys_type_function('antiseptic', 270, '1f0edd13-5e24-419b-ad01-001e637ee778', '',
       1);

           for nt_sys_type in
           select * from nt_sys_type_table
                             loop
               v_attr1 := nt_sys_type.a;
           v_attr2 := nt_sys_type.b;
           v_attr3 := nt_sys_type.c;
           v_attr4 := nt_sys_type.d;
           v_attr5 := nt_sys_type.e;

           select count(1) INTO checkf from ${SCHEMA}.medications
           where lower(name)=lower(v_attr1);

           if checkf>0 then
           update ${SCHEMA}.medications
           set name=v_attr1
             , weight=v_attr2
             , code=v_attr3
             , image=v_attr4
             , drone_id=v_attr5
           where lower(name)=lower(v_attr1);
           else
          insert into ${SCHEMA}.medications(
           name,
           weight,
           code,
           image,
           drone_id
           )
           values (
           v_attr1,
           v_attr2,
           v_attr3,
           v_attr4,
           v_attr5
           );
           end if;
               checkf :=0;
           end loop;
           drop table nt_sys_type_table;
           end;
 $$;
